import React from 'react';
import { Link } from 'react-router-dom';




const Navbar = () => {
  return (
    <>
    <div className='bg-white shadow-sm'>
        <div className="container">
          <div className="font-bold">
            Pink Affair
          </div>
        </div>
    </div>
    </>
  );
};

export default Navbar
